            .gif__picker input {
              border: 1px solid #ddd;
              border-radius: 2px;
              color: inherit;
              height: auto;
              line-height: 1.2;
              width: 93%;
              margin: 0 auto;
              display: block;
              margin-top: 16px;
            }
            
            .gif__picker {
              position: absolute;
              width: 250px;
              z-index: 1;
              bottom: 41px;
              right: 64px;
              background: white;
              box-shadow: 0px 3px 5px #BFBDBD;
              border: 1px solid #f1f1f1;
            }
            
            .gif__picker .image-picker {
              width: 100%
            }

            .gif__picker div:nth-child(1) div {
              flex-direction: row;
              flex-wrap: wrap;
              overflow-y: scroll;
              height: 250px;
              padding: .5rem;
            }
            
            .gif__picker input {
              padding: .5rem;
              margin-bottom: 0rem;
            }
            
            .gif__picker .giphy-gif {
              width: 114px;
              height: 90px;
              margin: -2px 1px 0px 1px;
